import React from 'react';
import { Outlet, Link } from "react-router-dom";
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import {
  createBrowserRouter,
  RouterProvider,
} from "react-router-dom";
//  @import url("https://fonts.googleapis.com/css?family=Open+Sans:300,400,700");
import reportWebVitals from './reportWebVitals';
import ErrorPage from './error-page';
import Canvasviewer from './canvasviewer';
import Listofpatients from './listpatient';
import Conversation from './pc';
import QuestionForm from './addflow';
import TreeView from './flowtree';
import Header from "./header";

const data = {
  lorem: {
    ipsum: 'dolor sit',
    amet: {
      consectetur: 'adipiscing',
      elit: [
        'duis',
        'vitae',
        {
          semper: 'orci'
        },
        {
          est: 'sed ornare'
        },
        'etiam',
        ['laoreet', 'tincidunt'],
        ['vestibulum', 'ante']
      ]
    },
    ipsum: 'primis'
  }
};


const router = createBrowserRouter([
  {
    path: "/",
    element: <App/>,
    errorElement : <ErrorPage/>
  },
  {
    path : "/mark",
    element : <Canvasviewer/>
  },
  {
    path : "/dashboard",
    element : <Listofpatients/>
  },
  {
    path : "/patientconvo",
    element : <Conversation/>
  },
  {
    path : "/addflow",
    element : <QuestionForm/>
  },
  {
    path : "/visualizeflow",
    // element : <TreeView apiUrl="http://localhost:5001/fetchalldata" />
    element : <Tree/>
  },
]);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <RouterProvider router={router} />
  </React.StrictMode>
);

reportWebVitals();
